void Sort_top::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"a_0\" :  \"" << a_0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"a_1\" :  \"" << a_1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"a_2\" :  \"" << a_2.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"a_3\" :  \"" << a_3.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"a_4\" :  \"" << a_4.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_0\" :  \"" << b_0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_0_ap_vld\" :  \"" << b_0_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_1\" :  \"" << b_1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_1_ap_vld\" :  \"" << b_1_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_2\" :  \"" << b_2.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_2_ap_vld\" :  \"" << b_2_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_3\" :  \"" << b_3.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_3_ap_vld\" :  \"" << b_3_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_4\" :  \"" << b_4.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"b_4_ap_vld\" :  \"" << b_4_ap_vld.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

